import jsPDF from 'jspdf-yworks';

export default function addFontBold() {
 const font = '';
 const callAddFont = function () {
  this.addFileToVFS('WorkSans-Regular.ttf', font);
  this.addFont('WorkSans-Regular.ttf', 'WorkSans', 'bold');
 };
 jsPDF.API.events.push(['addFonts', callAddFont])
};
